import React from "react"

class Riset extends React.Component {
  render() {
    return (
      <div>
        {(this.props.sunset === "") ? null : <p> Sunset: {this.props.sunset} </p>};
        {(this.props.sunrise === "") ? null : <p> Sunrise: {this.props.sunrise} </p>};
      </div>
    )
  }
}

export default Riset;
